// life cycle -->Birth ,growth ,delete

class App extends React.Component{
    constructor(){
        super();
        this.state={
            name:"welcome",
            value:"All"
        }
    }
    render(){
        return(
            <div>
                <p>{this.state.name}</p>
                <p>{this.state.value}</p>

            </div>
        )
    }
}

export default App;
